    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1599236366361,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1601672779088,"commentText":"This example highlights how Clojure achieves efficient immutability. Copies of data are not made when creating new data structures from existing ones. Instead, the clever use of pointers make it so that new data can be created while keeping existing data unchanged. <br><br>Because of this clever approach Clojure programmers should feel welcome to create new data structures from existing ones with functions like <font face=\"Courier\">cons</font>, <font face=\"Courier\">conj</font>, <font face=\"Courier\">assoc</font>, <font face=\"Courier\">dissoc</font>, and others. As a beginning Clojure programmer I tried to avoid creating new maps and lists from existing ones because I thought that violated the rules of immutability. However, I soon realized that the cost of doing so is a pointer which is not that significant.<br><br>This program creates some data structures to hold my name and the names of my siblings (I have a lot of them). I create a list of names and then a map of names.","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"","linesBelow":"","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-23":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-23","timestamp":1512007139626,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":23,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-22","lineNumber":1,"column":22,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609545363693,"commentText":"This creates a binding to a list with just my name in it.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"(def myself '(\"Mark\"))","startRow":0,"startColumn":0,"endRow":0,"endColumn":22}],"imageURLs":["media/images/1609545359016-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/updating.clj","viewableBlogText":"(def myself '(\"Mark\"))","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-81":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-81","timestamp":1512007147722,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":81,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-80","lineNumber":2,"column":56,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1601672877707,"commentText":"<font face=\"Courier\">conj</font> (short for <b>conj</b>oin) adds a series of items to a list.<div><br></div><div>Clojure lists are linked lists so adding to the front of the list is very efficient.</div><div><br></div><div>When conjoining multiple items each one is added to the front of the list in order.</div><div><br></div><div>So, the new list will grow like this:</div><div><br></div><div>head -&gt; \"Mark\"&nbsp;&nbsp;</div><div>head -&gt; \"Adam\" \"Mark\"&nbsp;&nbsp;<br></div><div>head -&gt; \"Dan\" \"Adam\" \"Mark\"&nbsp;&nbsp;<br></div><div>head -&gt; \"Mike\" \"Dan\" \"Adam\" \"Mark\"&nbsp;&nbsp;</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"(conj myself \"Adam\" \"Dan\" \"Mike\")","startRow":1,"startColumn":22,"endRow":1,"endColumn":55}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"0","currentFilePath":"/updating.clj","viewableBlogText":"(def myself '(\"Mark\")) \n(def myself-with-bros (conj myself \"Adam\" \"Dan\" \"Mike\"))","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-3","displayCommentEvent":{"id":"ev-81","timestamp":1512007147722,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":81,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-80","lineNumber":2,"column":56,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609545389709,"commentText":"Notice from the picture that the old list is part of the new list.<div><br></div><div>This is not a copy. <font face=\"Courier\">conj</font> added some new nodes in a linked list but that did not affect the 'myself' list.</div><div><br></div><div>Any part of the code that uses 'myself' will always see the same values in it. All data is immutable!</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"myself","startRow":0,"startColumn":5,"endRow":0,"endColumn":11},{"fileId":"fileId-0","selectedText":"myself-with-bros","startRow":1,"startColumn":5,"endRow":1,"endColumn":21}],"imageURLs":["media/images/1609545386625-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/updating.clj","viewableBlogText":"(def myself '(\"Mark\")) \n(def myself-with-bros (conj myself \"Adam\" \"Dan\" \"Mike\"))","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-138":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-138","timestamp":1512007156136,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":138,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-137","lineNumber":3,"column":55,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609545416510,"commentText":"Not surprisingly, the same thing happens with this list.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"(def myself-with-sisters (conj myself \"Coleen\" \"Katy\"))","startRow":2,"startColumn":0,"endRow":2,"endColumn":55}],"imageURLs":["media/images/1609545412978-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"0","currentFilePath":"/updating.clj","viewableBlogText":"(def myself '(\"Mark\")) \n(def myself-with-bros (conj myself \"Adam\" \"Dan\" \"Mike\")) \n(def myself-with-sisters (conj myself \"Coleen\" \"Katy\"))","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-265":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-265","timestamp":1512007182214,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":265,"type":"INSERT","fileId":"fileId-0","character":"\r","previousNeighborId":"ev-262","lineNumber":7,"column":27,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1601673175975,"commentText":"The attached screenshot is the output when I print the lists.<div><br></div><div>The key fact to notice here is that once a list is created and bound to a name that list will never change.</div><div><br></div><div>Further, the way Clojure achieves this is efficient because copies of values are not made. The system makes clever use of pointers to guarantee efficient immutability.&nbsp;</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"(println \"me with sisters\" myself-with-sisters) \n(println \"me with bros\" myself-with-bros) \n(println \"just me\" myself)","startRow":4,"startColumn":0,"endRow":6,"endColumn":26}],"imageURLs":["media/images/img_3.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"4","linesBelow":"0","currentFilePath":"/updating.clj","viewableBlogText":"(def myself '(\"Mark\")) \n(def myself-with-bros (conj myself \"Adam\" \"Dan\" \"Mike\")) \n(def myself-with-sisters (conj myself \"Coleen\" \"Katy\")) \n \n(println \"me with sisters\" myself-with-sisters) \n(println \"me with bros\" myself-with-bros) \n(println \"just me\" myself) ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-306":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-306","timestamp":1512007195649,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":306,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-305","lineNumber":11,"column":25,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609545449121,"commentText":"Clojure is equally clever with its other data types.<div><br></div><div>Here I create a map that I will add my siblings to.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"(def me-map {:me \"Mark\"})","startRow":10,"startColumn":0,"endRow":10,"endColumn":25}],"imageURLs":["media/images/1609545445925-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/updating.clj","viewableBlogText":"(def me-map {:me \"Mark\"})","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-7","displayCommentEvent":{"id":"ev-306","timestamp":1512007195649,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":306,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-305","lineNumber":11,"column":25,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1601673327260,"commentText":"The key in this map has a colon in it.<br><br>Clojure has 'keywords' (these are not the same as keywords or reserved words in other languages). <br><br>A keyword is like a string. It is used as a name for something. <br><br>One advantage of using keywords instead of strings to name things is that they are a little easier to type.<br><br>With a keyword you only need to type one special character, the colon. A string needs a quote at the beginning and the end of it.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":":me","startRow":10,"startColumn":13,"endRow":10,"endColumn":16}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/updating.clj","viewableBlogText":"(def me-map {:me \"Mark\"})","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-387":[{"id":"commentId-8","displayCommentEvent":{"id":"ev-387","timestamp":1512007202327,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":387,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-386","lineNumber":12,"column":79,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609545474564,"commentText":"<font face=\"Courier\">assoc</font> allows you to add new values to an existing map. Look at the picture associated with this comment.<div><br></div><div>You can think of Clojure as using pointers to create two separate maps that are linked together.</div><div><br></div><div>If there is an attempt to read a value from <font face=\"Courier\">family-map-with-bros</font> the system will start with the first map and look for it there. If a key cannot be found there it will follow the pointer to the next part of the map and search for the key there.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"(def family-map-with-bros (assoc me-map :bro1 \"Adam\" :bro2 \"Dan\" :bro3 \"Mike\"))","startRow":11,"startColumn":0,"endRow":11,"endColumn":79}],"imageURLs":["media/images/1609545471064-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"0","currentFilePath":"/updating.clj","viewableBlogText":"(def me-map {:me \"Mark\"}) \n(def family-map-with-bros (assoc me-map :bro1 \"Adam\" :bro2 \"Dan\" :bro3 \"Mike\"))","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-461":[{"id":"commentId-9","displayCommentEvent":{"id":"ev-461","timestamp":1512007208050,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":461,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-460","lineNumber":13,"column":72,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609545498237,"commentText":"I can do the same with this map as well.<div><br></div><div>Anyone who has a reference to <font face=\"Courier\">me-map</font> will only ever find one entry in it.</div><div><br></div><div>However, anyone who has a reference to the other maps can find more entries.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"(def family-map-with-sisters (assoc me-map :sis1 \"Coleen\" :sis2 \"Katy\"))","startRow":12,"startColumn":0,"endRow":12,"endColumn":72}],"imageURLs":["media/images/1609545494975-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"0","currentFilePath":"/updating.clj","viewableBlogText":"(def me-map {:me \"Mark\"}) \n(def family-map-with-bros (assoc me-map :bro1 \"Adam\" :bro2 \"Dan\" :bro3 \"Mike\")) \n(def family-map-with-sisters (assoc me-map :sis1 \"Coleen\" :sis2 \"Katy\"))","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-534":[{"id":"commentId-10","displayCommentEvent":{"id":"ev-534","timestamp":1512007214413,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":534,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-533","lineNumber":14,"column":71,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609545525193,"commentText":"<font face=\"Courier\">merge</font> is a function that combines maps together.<div><br></div><div>You can think of <font face=\"Courier\">whole-family</font> logically as looking like the image drawn in the picture.</div><div><br></div><div>Searching for values in this map will start at the top map and work its way down to the associated structures until the key is found or there are no more maps underneath.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"(def whole-family (merge family-map-with-bros family-map-with-sisters))","startRow":13,"startColumn":0,"endRow":13,"endColumn":71}],"imageURLs":["media/images/1609545522588-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"0","currentFilePath":"/updating.clj","viewableBlogText":"(def me-map {:me \"Mark\"}) \n(def family-map-with-bros (assoc me-map :bro1 \"Adam\" :bro2 \"Dan\" :bro3 \"Mike\")) \n(def family-map-with-sisters (assoc me-map :sis1 \"Coleen\" :sis2 \"Katy\")) \n(def whole-family (merge family-map-with-bros family-map-with-sisters))","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-584":[{"id":"commentId-11","displayCommentEvent":{"id":"ev-584","timestamp":1512007219322,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":584,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-583","lineNumber":15,"column":48,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609545556539,"commentText":"The <font face=\"Courier\">dissoc</font> function removes key value pairs from a map.<div><br></div><div>But, even this doesn't actually change any of the maps.</div><div><br></div><div>Logically, you can think of there being a new portion added to the map (the part in red in the attached picture).</div><div><br></div><div>When a key is searched for and found in this part of the map it will immediately say that the value is not present. So, removing from a map doesn't alter the rest of the maps' immutability either.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"(def no-m-names (dissoc whole-family :me :bro3))","startRow":14,"startColumn":0,"endRow":14,"endColumn":48}],"imageURLs":["media/images/1609545553337-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"4","linesBelow":"0","currentFilePath":"/updating.clj","viewableBlogText":"(def me-map {:me \"Mark\"}) \n(def family-map-with-bros (assoc me-map :bro1 \"Adam\" :bro2 \"Dan\" :bro3 \"Mike\")) \n(def family-map-with-sisters (assoc me-map :sis1 \"Coleen\" :sis2 \"Katy\")) \n(def whole-family (merge family-map-with-bros family-map-with-sisters)) \n(def no-m-names (dissoc whole-family :me :bro3))","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-801":[{"id":"commentId-12","displayCommentEvent":{"id":"ev-801","timestamp":1512007246797,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":801,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-800","lineNumber":21,"column":27,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1601673768933,"commentText":"Here are the maps printed to the screen.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"(println \"family with no M names\" no-m-names) \n(println \"whole family\" whole-family) \n(println \"me with sisters\" family-map-with-sisters) \n(println \"me with bros\" family-map-with-bros) \n(println \"me map\" me-map)","startRow":16,"startColumn":0,"endRow":20,"endColumn":25}],"imageURLs":["media/images/img_9.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"6","linesBelow":"0","currentFilePath":"/updating.clj","viewableBlogText":"(def me-map {:me \"Mark\"}) \n(def family-map-with-bros (assoc me-map :bro1 \"Adam\" :bro2 \"Dan\" :bro3 \"Mike\")) \n(def family-map-with-sisters (assoc me-map :sis1 \"Coleen\" :sis2 \"Katy\")) \n(def whole-family (merge family-map-with-bros family-map-with-sisters)) \n(def no-m-names (dissoc whole-family :me :bro3)) \n \n(println \"family with no M names\" no-m-names) \n(println \"whole family\" whole-family) \n(println \"me with sisters\" family-map-with-sisters) \n(println \"me with bros\" family-map-with-bros) \n(println \"me map\" me-map) ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}]};
